import React, { Component } from 'react';

import Box from './Box';
import NewBoxForm from './NewBoxForm';

class BoxList extends Component {
  render(){
    return (
      <div>
        <NewBoxForm/>
        <Box colour='red' width='100px' height='100px'/>
      </div>
    )
  }
}

export default BoxList;
